            gen4.push(pokemon)
        }
        setGen4(gen4)
        //gen5
        let gen5 = []
        for(let i = 494; i<649; i++){
            let pokemon = pokemonArray[i - 1]
            gen5.push(pokemon)
        }
        setGen5(gen5)
        //gen6
        let gen6 = []
        for(let i = 645; i<721; i++){
            let pokemon = pokemonArray[i - 1]
            gen6.push(pokemon)
        }
        setGen6(gen6)
        //gen7
        let gen7 = []
        for(let i = 722; i<802; i++){
            let pokemon = pokemonArray[i - 1]
            gen7.push(pokemon)
        }
        setGen7(gen7)
        //gen8
        let gen8 = []
        for(let i = 803; i<905; i++){
            let pokemon = pokemonArray[i - 1]
