        <>
            <div className="page-top">
                <div className="title">
                    <h1 id="title-main">Pokedex</h1>
                    <h4 id="subtitle"></h4>

                </div>
                <div className="row">
                    <button className="button-thin" onClick={setSelectedGen(gen1)}>Gen1</button><button className="button-thin" onClick={setSelectedGen(gen2)}>Gen2</button>
                    <button className="button-thin" onClick={setSelectedGen(gen3)}>Gen3</button><button className="button-thin" onClick={setSelectedGen(gen4)}>Gen4</button>
                    <button className="button-thin" onClick={setSelectedGen(gen5)}>Gen5</button><button className="button-thin" onClick={setSelectedGen(gen6)}>Gen6</button>
                    <button className="button-thin" onClick={setSelectedGen(gen7)}>Gen7</button><button className="button-thin" onClick={setSelectedGen(gen8)}>Gen8</button>

